const trackPageView=async()=>{const e=window.location.href,t=document.title,a={pageUrl:e,clickTime:(new Date).toISOString(),pageTitle:t};try{const e=await fetch("https://uncelibate-malisa-limy.ngrok-free.dev/api/track-page-view",{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify(a)});e.ok?console.log("Page view data sent successfully."):console.error("Failed to send page view data. Server status:",e.status)}catch(e){console.error("Error sending page view data:",e)}};trackPageView();